import { useEffect, useState } from "react";
import axios from 'axios'

function RegisterForm() {
    const [username, setUserName] = useState('');
    const [password, setPassword] = useState('');

    const registerUser = (e) => {
        console.log(e)
        e.preventDefault();
        if (username === '' || password === '') {
            console.log('Please fill in all fields')
        }
    }

    useEffect(() => {
        console.log(username, password)
    }, [username, password])

    return (
        <form className="w-full max-w-sm" onSubmit={registerUser}>
            <div className="md:flex md:items-center mb-6">
                <div className="md:w-1/3">
                    <label className="block text-gray-500 font-bold md:text-right mb-1 md:mb-0 pr-4" htmlFor="inline-full-name">
                        Username
                    </label>
                </div>
                <div className="md:w-2/3">
                    <input value={username} onChange={(e) => setUserName(e.target.value)} className="bg-gray-200 appearance-none border-2 border-gray-200 rounded w-full py-2 px-4 text-gray-700 leading-tight focus:outline-none focus:bg-white focus:border-purple-500" id="inline-full-name" type="text" />
                </div>
            </div>
            <div className="md:flex md:items-center mb-6">
                <div className="md:w-1/3">
                    <label className="block text-gray-500 font-bold md:text-right mb-1 md:mb-0 pr-4" htmlFor="inline-password">
                        Password
                    </label>
                </div>
                <div className="md:w-2/3">
                    <input value={password} onChange={(e) => setPassword(e.target.value)} className="bg-gray-200 appearance-none border-2 border-gray-200 rounded w-full py-2 px-4 text-gray-700 leading-tight focus:outline-none focus:bg-white focus:border-purple-500" id="inline-password" type="password" placeholder="******************" />
                </div>
            </div>

            <div className="md:flex md:items-center">
                <div className="md:w-1/3"></div>
                <div className="md:w-2/3">
                    <button onSubmit={registerUser} className="shadow bg-purple-500 hover:bg-purple-400 focus:shadow-outline focus:outline-none text-white font-bold py-2 px-4 rounded" type="button">
                        Sign Up
                    </button>
                </div>
            </div>
        </form>
    );
}

export default RegisterForm;
